<?php
/**
 * This is used to render the blob images from the database for older browsers
 * such as IE8. IE8 cannot use img tags with data:images/png as the src so instead point it
 * here and this will render the image and fix that problem
 */

$id = isset($_REQUEST['id']) ? $_REQUEST['id'] : 16;
$type = isset($_REQUEST['type']) ? $_REQUEST['type'] : 'sig';
$CI =& get_instance();

//$CI = array('something', 'something else');

//echo "<pre>";
//print_r($CI);
//echo "</pre>";
//exit;

$image = $CI->user_model->get_image($type, $id);

if($image) {
    $data = $image;
} else {
    $data = '';
}
$data = base64_decode($data);
$im = imagecreatefromstring($data);
if($im !== false) {
    header('Content-Type: image/png');
    imagepng($im);
    imagedestroy($im);
}
